    nr INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    beschreibung TEXT,
    typ TEXT NOT NULL CHECK (typ IN ('bug', 'idee')) DEFAULT 'bug',
    status TEXT NOT NULL CHECK (status IN ('offen', 'in_bearbeitung', 'geloest', 'geschlossen', 'abgelehnt')) DEFAULT 'offen',
    prioritaet TEXT NOT NULL CHECK (prioritaet IN ('niedrig', 'mittel', 'hoch', 'kritisch')) DEFAULT 'mittel',
    erstellt_am DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    aktualisiert_am DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    geloest_am DATETIME,
    notizen TEXT
);

