CREATE INDEX IF NOT EXISTS idx_eintraege_status ON eintraege (status);
CREATE INDEX IF NOT EXISTS idx_eintraege_prioritaet ON eintraege (prioritaet);
CREATE INDEX IF NOT EXISTS idx_eintraege_erstellt_am ON eintraege (erstellt_am);

CREATE TABLE IF NOT EXISTS status_historie (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    eintrag_nr INTEGER NOT NULL,
    alter_status TEXT NOT NULL,
    neuer_status TEXT NOT NULL,
    geaendert_am DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    kommentar TEXT,
    FOREIGN KEY (eintrag_nr) REFERENCES eintraege (nr) ON DELETE CASCADE
);

