CREATE INDEX IF NOT EXISTS idx_status_historie_geaendert_am ON status_historie (geaendert_am);

CREATE TABLE IF NOT EXISTS tags (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL UNIQUE,
    farbe TEXT DEFAULT '#7c7c6b'
);

